import React, { Component } from 'react'
import storageUtils from '../../../utils/storageUtils'

export default class center extends Component {
    render() {
        const user = storageUtils.getUser()
        return (
            <div>
                <p>手机号码：{user.phone}</p>
            </div>
        )
    }
}
